    const styleNav = {
        display: 'flex',
        justifyContent: 'center',
        marginTop: 20,
        marginBottom: 20,
    };

    return (
        <Grid container spacing={2} style={styleNav}>
            <Grid item xs={8}>
                <h2>Proyectos en acci√≥n</h2>
            </Grid>
            <Grid item xs={8} style={{backgroundColor: "#FFFCEB"}}>
                <ul className="project-list-ul">
                    {projects.map((p) => (
                          <Project project={p} key={p.id} />
                    ))}
                </ul>
            </Grid>
        </Grid>

    );
}
